import React from "react";
import "./Header.scss";
import { Navbar, Nav, NavDropdown } from "react-bootstrap";
import { Link } from "react-router-dom";

function Header() {
  return (
    //look into user specific greeting .. Sign In / User Name

    <Navbar className="nav__color" variant="dark" expand="xl">
      <div className="nav__bar">
        <Navbar.Brand className="nav__brand" href="#home">
          eShop
        </Navbar.Brand>
        <Navbar.Toggle aria-controls="basic-navbar-nav" />
        <Navbar.Collapse id="basic-navbar-nav">
          <Nav className="mr-auto">
            <Nav.Link href="/home">Home</Nav.Link>
            <Nav.Link href="/login">Sign in</Nav.Link>
            <NavDropdown title="Shop" id="basic-nav-dropdown">
              <NavDropdown.Item href="#action/3.1">
                Best Sellers
              </NavDropdown.Item>
              <NavDropdown.Item href="#action/3.2">On Sale</NavDropdown.Item>
              <NavDropdown.Item href="#action/3.3">Categories</NavDropdown.Item>
              <NavDropdown.Divider />
              <NavDropdown.Item href="#action/3.4">Contact Us</NavDropdown.Item>
            </NavDropdown>
          </Nav>
        </Navbar.Collapse>
      </div>
    </Navbar>
  );
}

export default Header;
